-- ----------------------------
-- Event structure for shopping_update
-- ----------------------------
DROP EVENT IF EXISTS `shopping_update`;
delimiter ;;
CREATE DEFINER = `root`@`localhost` EVENT `shopping_update`
ON SCHEDULE
EVERY '1' MINUTE STARTS '2020-01-19 18:17:29'
ON COMPLETION PRESERVE
DO BEGIN 
	UPDATE pe_shopping	SET valid=0 where nowtime<NOW(); 
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
